const FlipCard = ({ char, size = 'default', animate = true }) => {
  const [currentChar, setCurrentChar] = useState(char);
  const [previousChar, setPreviousChar] = useState(char);
  const [isFlipping, setIsFlipping] = useState(false);

  const sizes = {
    default: {
      container: "w-8 h-12 sm:w-12 sm:h-20 md:w-16 md:h-24",
      text: "text-2xl sm:text-4xl md:text-5xl",
      hinge: "w-0.5 h-2 -left-0.5 sm:w-1 sm:h-2 sm:-left-1",
      hingeRight: "w-0.5 h-2 -right-0.5 sm:w-1 sm:h-2 sm:-right-1"
    },
    medium: {
      container: "w-6 h-10 sm:w-10 sm:h-16 md:w-14 md:h-22",
      text: "text-xl sm:text-3xl md:text-4xl",
      hinge: "w-0.5 h-1.5 -left-0.5 sm:w-1 sm:h-2 sm:-left-1",
      hingeRight: "w-0.5 h-1.5 -right-0.5 sm:w-1 sm:h-2 sm:-right-1"
    },
    small: {
      container: "w-5 h-8 sm:w-8 sm:h-12 md:w-10 md:h-16",
      text: "text-lg sm:text-2xl md:text-3xl",
      hinge: "w-0.5 h-1.5 -left-0.5 sm:w-0.5 sm:h-2 sm:-left-0.5",
      hingeRight: "w-0.5 h-1.5 -right-0.5 sm:w-0.5 sm:h-2 sm:-right-0.5"
    }
  };

  const currentSize = sizes[size] || sizes.default;

  useEffect(() => {
    if (char !== currentChar) {
      if (animate) {
        setPreviousChar(currentChar);
        setCurrentChar(char);
        setIsFlipping(true);

        const timer = setTimeout(() => {
          setIsFlipping(false);
        }, 300);

        return () => clearTimeout(timer);
      } else {
        setCurrentChar(char);
        setPreviousChar(char);
      }
    }
  }, [char, currentChar, animate]);

  return (
    <div className={`relative ${currentSize.container} bg-[#0e0014] rounded-md shadow-xl`} style={{ perspective: '1000px' }}>

      <div className="absolute inset-0 flex flex-col rounded-md overflow-hidden">
        <div className="relative h-1/2 w-full bg-[#0e0014] border-b border-black/50 flex justify-center items-end overflow-hidden">
          <span className={` ${currentSize.text} font-bold text-white translate-y-[50%]`}>
            {currentChar}
          </span>
          <div className="absolute inset-0 bg-linear-to-b from-black/40 to-transparent pointer-events-none"></div>
        </div>
        <div className="relative h-1/2 w-full bg-[#0e0014] border-t border-[#333] flex justify-center items-start overflow-hidden">
          <span className={` ${currentSize.text} font-bold text-white translate-y-[-50%]`}>
            {currentChar}
          </span>
          <div className="absolute inset-0 bg-linear-to-t from-black/40 to-transparent pointer-events-none"></div>
        </div>
      </div>

      <AnimatePresence>
        {isFlipping && (
          <>
            <motion.div
              key={`top-${previousChar}`}
              initial={{ rotateX: 0 }}
              animate={{ rotateX: -90 }}
              transition={{ duration: 0.15, ease: 'easeIn' }}
              className="absolute top-0 left-0 w-full h-1/2 bg-[#0e0014] border-b border-black/50 rounded-t-md overflow-hidden flex justify-center items-end z-20 origin-bottom"
              style={{ transformOrigin: 'bottom', backfaceVisibility: 'hidden' }}
            >
              <span className={` ${currentSize.text} font-bold text-white translate-y-[50%]`}>
                {previousChar}
              </span>
              <div className="absolute inset-0 bg-linear-to-b from-black/40 to-transparent pointer-events-none"></div>
              <motion.div
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ duration: 0.15 }}
                className="absolute inset-0 bg-black/50"
              />
            </motion.div>

            <motion.div
              key={`bottom-${currentChar}`}
              initial={{ rotateX: 90 }}
              animate={{ rotateX: 0 }}
              transition={{ duration: 0.15, delay: 0.15, ease: 'easeOut' }}
              className="absolute bottom-0 left-0 w-full h-1/2 bg-[#0e0014] border-t border-[#333] rounded-b-md overflow-hidden flex justify-center items-start z-30 origin-top"
              style={{ transformOrigin: 'top', backfaceVisibility: 'hidden' }}
            >
              <span className={`${currentSize.text} font-bold text-white translate-y-[-50%]`}>
                {currentChar}
              </span>
              <div className="absolute inset-0 bg-linear-to-t from-black/40 to-transparent pointer-events-none"></div>
              <motion.div
                initial={{ opacity: 1 }}
                animate={{ opacity: 0 }}
                transition={{ duration: 0.15, delay: 0.15 }}
                className="absolute inset-0 bg-white/10"
              />
            </motion.div>
          </>
        )}
      </AnimatePresence>

      {isFlipping && (
        <div className="absolute bottom-0 left-0 w-full h-1/2 bg-[#0e0014] border-t border-[#333] rounded-b-md overflow-hidden flex justify-center items-start z-10">
          <span className={` ${currentSize.text} font-bold text-white translate-y-[-50%]`}>
            {previousChar}
          </span>
          <div className="absolute inset-0 bg-linear-to-t from-black/40 to-transparent pointer-events-none"></div>
        </div>
      )}

      <div className="absolute inset-x-0 top-1/2 h-px sm:h-0.5 bg-black z-40 -translate-y-1/2 shadow-sm"></div>

      <div className={`absolute ${currentSize.hinge} top-1/2 bg-[#444] -translate-y-1/2 rounded-l-sm`}></div>
      <div className={`absolute ${currentSize.hingeRight} top-1/2 bg-[#444] -translate-y-1/2 rounded-r-sm`}></div>
    </div>
  );
};

const Countdown = () => {
  const [timeLeft, setTimeLeft] = useState({
    days: "00",
    hours: "00",
    minutes: "00",
    seconds: "00",
  });

  useEffect(() => {
    const targetDate = new Date("2026-02-26T12:00:00").getTime();

    const updateTimer = () => {
      const now = new Date().getTime();
      const difference = targetDate - now;

      if (difference > 0) {
        const days = Math.floor(difference / (1000 * 60 * 60 * 24));
        const hours = Math.floor((difference % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
        const minutes = Math.floor((difference % (1000 * 60 * 60)) / (1000 * 60));
        const seconds = Math.floor((difference % (1000 * 60)) / 1000);

        setTimeLeft({
          days: days.toString().padStart(2, "0"),
          hours: hours.toString().padStart(2, "0"),
          minutes: minutes.toString().padStart(2, "0"),
          seconds: seconds.toString().padStart(2, "0"),
        });
      }
    };

    const interval = setInterval(updateTimer, 1000);
    updateTimer();

    return () => clearInterval(interval);
  }, []);

  const renderDigits = (value, label) => (
    <div className="flex flex-col items-center mx-2 sm:mx-4">
      <div className="flex gap-1">
        {value.split("").map((digit, i) => (
          <FlipCard key={i} char={digit} size="medium" />
        ))}
      </div>
      <span className="text-white/60 text-[10px] sm:text-xs mt-2 uppercase tracking-wider">{label}</span>
    </div>
  );

  return (
    <div className="grid grid-cols-4 gap-4 mt-12 sm:flex sm:justify-center sm:mt-16 sm:gap-0 sm:gap-y-4 flex-wrap">
      {renderDigits(timeLeft.days, "Days")}
      {renderDigits(timeLeft.hours, "Hours")}
      {renderDigits(timeLeft.minutes, "Minutes")}
      {renderDigits(timeLeft.seconds, "Seconds")}
    </div>
  );
};

const PreLoader = ({ initialScrambleTicks = 2, show = true }) => {
  const targetText = "FEEL THE ENIGMA";
  const [displayText, setDisplayText] = useState([]);

  useEffect(() => {
    const chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
    const initial = targetText.split('').map(char =>
      char === ' ' ? ' ' : chars[Math.floor(Math.random() * chars.length)]
    );
    setDisplayText(initial);
  }, []);

  useEffect(() => {
    let ticks = 0;
    const interval = setInterval(() => {
      ticks++;
      setDisplayText(current => {
        const chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

        const scrambleTicks = initialScrambleTicks;
        const ticksPerLock = 2;

        const lockedCount = Math.max(0, Math.floor((ticks - scrambleTicks) / ticksPerLock));

        let allMatched = true;

        const next = current.map((char, index) => {
          const targetChar = targetText[index];

          if (targetChar === ' ') return ' ';

          if (index < lockedCount) {
            return targetChar;
          }

          allMatched = false;

          let nextChar = chars[Math.floor(Math.random() * chars.length)];

          if (nextChar === targetChar) {
            nextChar = chars[(chars.indexOf(nextChar) + 1) % chars.length];
          }
          return nextChar;
        });

        if (allMatched) clearInterval(interval);
        return next;
      });
    }, 150);

    return () => clearInterval(interval);
  }, [initialScrambleTicks]);

  return (
    <AnimatePresence>
      {show && (
      <motion.div
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        className="fixed inset-0 w-full h-screen bg-[#12001a] z-50 flex flex-col items-center justify-center overflow-hidden"
      >
        <div className="absolute inset-0 z-0 opacity-20 pointer-events-none">
          <BgVector />
        </div>

        <div className="relative z-10 px-4 w-full max-w-7xl mx-auto flex flex-col items-center">
          <img src="/AdvityaTitle.png" alt="Advitya Title" className="w-64 sm:w-80 md:w-96 mb-36" />

          <div className="flex flex-wrap justify-center gap-4 sm:gap-8 md:gap-12">
            {(() => {
              const words = [];
              let currentWord = [];

              displayText.forEach((char, index) => {
                if (char === ' ') {
                  if (currentWord.length > 0) {
                    words.push(currentWord);
                    currentWord = [];
                  }
                } else {
                  currentWord.push({ char, index });
                }
              });
              if (currentWord.length > 0) {
                words.push(currentWord);
              }

              return words.map((word, wordIndex) => (
                <div key={wordIndex} className="flex gap-1 sm:gap-2">
                  {word.map((item) => (
                    <FlipCard key={item.index} char={item.char} />
                  ))}
                </div>
              ));
            })()}
          </div>

          <Countdown />
        </div>
      </motion.div>
      )}
    </AnimatePresence>
  );
};

export default PreLoader;
